import React from "react";

import "./custom-button.scss";

function CustomButton({ children, isGoogleSignIn, ...otherProps }) {
  return (
    <button className={`'custom-button'`} {...otherProps}>
      {children}
    </button>
  );
}

export default CustomButton;
